import "./HorizontalNavBarStyle.css";
import {Link} from "react-router-dom";
import './App.css';

function App() {

  let MyProfile;
  if ("ROLE_ADMIN" === "ROLE_ADMIN")
  {
    var sellersAndUsers = (
        <>
          <li className="menu">
            {" "}
            <Link to="/users"> Users </Link>{" "}
          </li>
          <li class="menu">
            {" "}
            <Link to="/sellers"> Sellers </Link>{" "}
          </li>
        </>
    );
    MyProfile = <></>;
  }

  else {
    var sellersAndUsers = <li className="menu">
      {" "}
      <Link to="/sellers"> Sellers </Link>{" "}
    </li>

    MyProfile = <li className="menu">
      {" "}
      <Link to="/myProfile"> My Profile </Link>{" "}
    </li>;
  }

  return (
      <div>
        <ul class="menu">
          <li class="menu">
            {" "}
            <Link to="/products"> Products </Link>{" "}
          </li>
          {sellersAndUsers}
          {MyProfile}
          <li class="menu">
            {" "}
            <Link to="/logout"> Log Out </Link>{" "}
          </li>
        </ul>
      </div>
  );

}

export default App;
